import React, { Component } from 'react';
import './App.css';
import './video/treats_video.mp4';

class App extends Component {



  render() {
    return (
      <div className="App">

        <header className="App-header">
        <h1 class="victory">FERRARiROCHER</h1>

         <video id="background-video" loop autoPlay>
                <source src="https://www.youtube.com/watch?v=j5z02QN8XvE" type="video/mp4" />
                Your browser does not support the video tag.
            </video>


        </header>


      </div>
    );
  }
}

export default App;
